import './App.css';
import Navbar from './Components/Navbar/Navbar';
import {  Routes, Route } from 'react-router-dom';
import Shopcategory from './pages/ShopCategory';
import Product from './pages/Product';
import LoginSignup from './pages/LoginSignup';
import Shop from './pages/Shop';
import Cart from './pages/Cart';
import Footer from './Components/Footer/Footer';
import mans_banner from './Components/Assets/man_banner.jpeg'
import ShopContextProvider from './Context/ShopContext';


function App() {
  return (
    <div className="App">
      <ShopContextProvider>

        <Navbar />
        <Routes>
          <Route path='/' element={<Shop />} />
          <Route path='/mans' element={<Shopcategory banner={mans_banner} category="men" />} />
          <Route path='/womans' element={<Shopcategory banner={mans_banner}  category="woman" />} />
          <Route path='/kids' element={<Shopcategory  banner={mans_banner} category="kid" />} />
          <Route path='/product' element={<Product />} />
          <Route path='/product/:product' element={<Product />} /> {/* Nested route */}
          <Route path='/cart' element={<Cart />} />
          <Route path='/login' element={<LoginSignup />} />
        </Routes>
        <Footer/>

      </ShopContextProvider>
    </div>
  );
}

export default App;
